import React from 'react'
import '../Styles/Top2butt.css';

export default function Navigationbr() {
  return (
    <div className="container">
        
      {/* Buttons */}
      <div className="button-container">
        <button className="button" onClick={() => alert('Emergency 011-32144578')}>Emergency</button>
        <button className="button" onClick={() => alert('Make an appointment')}>Appointment</button>
      </div>
    </div>
  )
}
